import {BrowserRouter as Router,  Switch, Route} from "react-router-dom"

import navbar from "./component/navbar"


function App() {
  return (
    <div className="App">
      <Router>
          <Switch>
             
              <Route path="/navbar"  component={navbar}/>
            
          </Switch>
      </Router>
    </div>
  );
}

export default App;
